import React, { useRef, useState } from 'react';
import html2canvas from 'html2canvas';
import { write } from 'clipboard-polyfill';
import { ToastContainer, toast } from 'react-toastify';

const EleventhPage = () => {
    const screenshotRef = useRef(null);

    const [data, setData] = useState({
        time: "6:10",
        amount: "80.97 USDC",
        cash: "CA$107.25",
        min: "10"
    });

    const [imageDimension, setImageDimension] = useState("167");

    const onChangeHandler = (e) => {
        setData({ ...data, [e.target.name]: e.target.value });
    }

    const notify = (message) => toast.success(message, {
        containerId: 'success-toast',
        style: {
            background: 'black',
            color: 'white',
        },
    });

    const takeScreenshot = async () => {
        try {
            const canvas = await html2canvas(screenshotRef.current);
            const dataURL = canvas.toDataURL('image/png');

            const img = new Image();
            img.src = dataURL;

            img.onload = () => {
                const canvas = document.createElement("canvas");
                canvas.width = img.width;
                canvas.height = img.height;

                const context = canvas.getContext("2d");
                context.drawImage(img, 0, 0);

                // Convert canvas to blob
                canvas.toBlob((blob) => {
                    const clipboardItem = new ClipboardItem({ [blob.type]: blob });

                    // Use the clipboard-polyfill to copy the item
                    write([clipboardItem]).then(() => {
                        notify("Copied to clipboard");
                    }).catch((error) => {
                        console.error("Error copying image:", error);
                    });
                }, img.type);
            };
        } catch (error) {
            console.error('Error taking screenshot:', error);
        }
    };

    return (
        <>
            <>
                <div className="billing_childs">
                    <ToastContainer autoClose={1000} />
                    <div className="app-heading">
                        <h3>PREVIEW - <span>Mobile 11</span></h3>
                        <div class="slidecontainer">
                            <button onClick={() => takeScreenshot()}>Screenshot <i className="fa fa-copy"></i></button>
                            <span>{imageDimension + "%"}</span>
                            <input
                                type="range"
                                min="1"
                                max="500"
                                className="slider"
                                name="imageDimension"
                                value={imageDimension}
                                onChange={(e) => setImageDimension(e.target.value)}
                            />
                        </div>
                    </div>
                    <div className="mobile-view-wrapper">
                        <div className="artboard secondpage_font">
                            <foreignObject ref={screenshotRef}>
                                <svg
                                    xmlns="http://www.w3.org/2000/svg"
                                    xmlnsXlink="http://www.w3.org/1999/xlink"
                                    width={imageDimension + "%"}
                                    viewBox="0 0 1875 4059"
                                >
                                    <defs>
                                        <pattern
                                            id="pattern"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 107 34"
                                        >
                                            <image
                                                width="107"
                                                height="34"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                        <pattern
                                            id="pattern-2"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 442 199"
                                        >
                                            <image
                                                width="442"
                                                height="199"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                        <pattern
                                            id="pattern-3"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 30 24"
                                        >
                                            <image
                                                width="30"
                                                height="24"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                    </defs>
                                    <g data-name="Group 2" transform="translate(-2580)">
                                        <g data-name="Group 1">
                                            <path
                                                fill="#fff"
                                                d="M0 0H1875V4059H0z"
                                                data-name="Rectangle 1"
                                                transform="translate(2580)"
                                            ></path>
                                        </g>
                                        <image
                                            width="1007"
                                            height="1035"
                                            data-name="Image 1"
                                            transform="translate(3044 441)"
                                            xlinkHref="data:image/png;base64,"
                                        ></image>
                                        <path
                                            fill="url(#pattern)"
                                            d="M0 0H429V136H0z"
                                            data-name="Image 2"
                                            transform="translate(3993 66)"
                                        ></path>
                                        <path
                                            fill="url(#pattern-2)"
                                            d="M0 0H1809V814H0z"
                                            data-name="Image 3"
                                            transform="translate(2613 3201)"
                                        ></path>
                                        <path
                                            fill="url(#pattern-3)"
                                            d="M0 0H108V86H0z"
                                            data-name="Image 4"
                                            transform="translate(2789 75)"
                                        ></path>
                                        <text
                                            fill="#2461eb"
                                            data-name="80.97 USDC"
                                            fontFamily="CerebriSans-Bold, Cerebri Sans"
                                            fontSize="100"
                                            fontWeight="700"
                                            transform="translate(3540 1592)"
                                        >
                                            <tspan x="0" y="0" textAnchor="middle">
                                                {data.amount}
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#7e7f81"
                                            data-name="CA$107.25"
                                            fontFamily="Folio-Medium, Folio"
                                            fontSize="55"
                                            fontWeight="500"
                                            transform="translate(3540 1718)"
                                        >
                                            <tspan x="0" y="0" textAnchor="middle">
                                                {data.cash}
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#838487"
                                            data-name="This transaction usually takes less than 10 minutes"
                                            fontFamily="SegoeUI-Semibold, Segoe UI"
                                            fontSize="58"
                                            fontWeight="500"
                                            transform="translate(3540 1937)"
                                        >
                                            <tspan x="0" y="0" textAnchor="middle">
                                                This transaction usually takes less than {data.min} minutes
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#323232"
                                            data-name="6:10"
                                            fontFamily="SegoeUI-Semibold, Segoe UI"
                                            fontSize="80"
                                            fontWeight="500"
                                            transform="translate(2641 151)"
                                        >
                                            <tspan x="0" y="0">
                                                {data.time}
                                            </tspan>
                                        </text>
                                    </g>
                                </svg>
                            </foreignObject>
                        </div>
                    </div>
                </div>
                <div className="billing_childs">
                    <div className="app-heading">
                        <h3>CONTROLS</h3>
                    </div>
                    <div className="global_form_wrapper">
                        <div className="global_form_inner">
                            <label>Time</label>
                            <input
                                type="text"
                                value={data.time}
                                name="time"
                                onChange={(e) => onChangeHandler(e)}
                            />
                        </div>
                        <div className="global_form_inner">
                            <label>Amount</label>
                            <input
                                type="text"
                                value={data.amount}
                                name="amount"
                                onChange={(e) => onChangeHandler(e)}
                            />
                        </div>
                        <div className="global_form_inner">
                            <label>CA$</label>
                            <input
                                type="text"
                                value={data.cash}
                                name="cash"
                                onChange={(e) => onChangeHandler(e)}
                            />

                        </div>


                        <div className="global_form_inner">
                            <label>Min</label>
                            <input
                                type="text"
                                value={data.min}
                                name="min"
                                onChange={(e) => onChangeHandler(e)}
                            />
                        </div>
                    </div>
                </div>
            </>
        </>
    )
}



export default EleventhPage;